(2, 1, 'A WordPress Commenter', 'wapuu@wordpress.example', 'https://wordpress.org/', '', '2020-03-10 21:16:55', '2020-03-10 21:16:55', 'Hi, this is a comment.\nTo get started with moderating, editing, and deleting comments, please visit the Comments screen in the dashboard.\nCommenter avatars come from <a href=\"https://gravatar.com\" rel=\"nofollow ugc\">Gravatar</a>.', 0, '1', '', 'comment', 0, 0),
(3, 57, 'admin', 'hq@creativethemes.com', '', '188.237.250.238', '2020-03-13 10:09:36', '2020-03-13 10:09:36', 'Laoreet suspendisse interdum consectetur libero. Fames ac turpis egestas integer eget aliquet nibh praesent. Sed felis eget velit aliquet sagittis.', 0, '1', '', 'review', 0, 0),
(4, 66, 'admin', 'hq@creativethemes.com', '', '188.237.250.238', '2020-03-13 10:25:08', '2020-03-13 10:25:08', 'At auctor urna nunc id cursus metus aliquam eleifend. Ipsum nunc aliquet bibendum enim. Et malesuada fames ac turpis egestas sed tempus.', 0, '1', '', 'review', 0, 0),
(5, 68, 'admin', 'hq@creativethemes.com', '', '188.237.250.238', '2020-03-13 10:28:01', '2020-03-13 10:28:01', 'Diam sit amet nisl suscipit adipiscing. Faucibus pulvinar elementum integer enim neque volutpat ac. Aliquet eget sit amet tellus cras adipiscing enim eu. Ac feugiat sed lectus vestibulum. Commodo nulla facilisi nullam vehicula.', 0, '1', '', 'review', 0, 0),
(6, 155, 'admin', 'hq@creativethemes.com', '', '92.115.181.73', '2020-03-16 10:48:31', '2020-03-16 10:48:31', 'Amet commodo nulla facilisi nullam vehicula ipsum. Faucibus pulvinar elementum integer enim.', 0, '1', '', 'review', 0, 0),
(7, 157, 'admin', 'hq@creativethemes.com', '', '92.115.181.73', '2020-03-16 10:39:21', '2020-03-16 10:39:21', 'Vel fringilla est ullamcorper eget nulla. Tempor orci eu lobortis elementum. Ac tincidunt vitae semper quis lectus. \nVenenatis tellus in metus vulputate eu scelerisque. Vulputate ut pharetra sit amet aliquam id.', 0, '1', '', 'review', 0, 0),
(8, 159, 'admin', 'hq@creativethemes.com', '', '92.115.181.73', '2020-03-16 10:51:59', '2020-03-16 10:51:59', 'Sit amet venenatis urna cursus eget nunc scelerisque viverra mauris. Eu non diam phasellus vestibulum lorem sed.', 0, '1', '', 'review', 0, 0),
(9, 162, 'admin', 'hq@creativethemes.com', '', '92.115.181.73', '2020-03-16 10:29:47', '2020-03-16 10:29:47', 'Condimentum id venenatis a condimentum. Sit amet aliquam id diam maecenas ultricies. Imperdiet proin fermentum leo vel orci porta non pulvinar.', 0, '1', '', 'review', 0, 0);
